import{_ as e,c as o,o as t,V as a}from"./chunks/framework.OTU5OxHT.js";const f=JSON.parse('{"title":"常见问题","description":"","frontmatter":{},"headers":[],"relativePath":"daxpay/guides/other/常见问题.md","filePath":"daxpay/guides/other/常见问题.md","lastUpdated":1707230612000}'),r={name:"daxpay/guides/other/常见问题.md"},c=a('<h1 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题">¶</a></h1><blockquote><ol><li>在调用需要证书的接口事，出现 No appropriate protocol (protocol is disabled or cipher suites are inappropriate)错误</li></ol></blockquote><p>原因：ssl 握手失败，使用了java.security不支持的版本，换一下最新的JDK即可, 例如 corretto Jdk</p><blockquote><ol start="2"><li>支付订单有效期是多久，如何进行设置？</li></ol></blockquote><p>支付订单有效期默认是30分钟，如果超过30分钟，支付订单会自动失效。可以在管理后台设置默认的支付订单有效期。也可以通过调用接口设置支付订单有效期，接口如果传输了过期时间，优先使用接口传入的过期时间。</p><blockquote><ol start="3"><li>调用微信和支付宝的接口时，使用的是什么类型签名方式？</li></ol></blockquote><p>对调用各种第三方支付网关接口的签名方式，只要是支持<code>HMAC-SHA256</code>方式，都是使用<code>HMAC-SHA256</code>方式，签名过程都由支付网关进行了处理，不需要业务系统对这块进行额外处理。</p>',7),s=[c];function l(i,d,_,p,n,u){return t(),o("div",null,s)}const k=e(r,[["render",l]]);export{f as __pageData,k as default};
